import React from 'react';
import { Redirect } from 'react-router-dom';

//import Dashboard from './Dashboard';
//import Chat from './Chat'

export default function Backend(props) {
  return (
    <>
      <main className="Content">
          {props.children}
          <> 
              <Switch>
                  <Redirect from="/" to="/homepage" />
              </Switch>
          </>
      </main>
    </>
  );
}
